div.div:
Is has something to to with operator affinity which determines the order of evaluation. Like math, parenthesis have a higher priority than multiplications with have a higher priority than plus and minus. The second part of the expression will never get evaluated and thus ignored resulting in 1 e.g.
if(TRUE){1}else{0} + message("I'll never get printed")
. Including the parenthesis will force to first evaluate both parts seperatley and then do the plus resulting in 2.
